import './style.css';

function MiniCard(props) {

    return (
        <figure className='mini-card'>
            <a>

            <img className='img-mini-card' src={props.imgOne} alt='img'></img>
            <figcaption className='mask'>
                <div className='nano-card'>
                    {props.children}
                </div>
            </figcaption>
            </a>
        </figure>
    )
}

export default MiniCard;
